import '../styles/App.css';
import { View} from 'react'
import appHeader from "./Header"

class App extends Component{
  constructor(){
    super();
    this.state = {
      results: {}
    }
  }

  render() {
    return (
      <div className="App">
        {/* Parent Div */}
        <view><appHeader /></view>

        <div>
          {/* sidebar div */}
        </div>
        <div>
          {/* Map Div */}
        </div>
        <div>
          {/* Service Info div */}
        </div>
        <div>
          {/* Hos Info div */}
        </div>
      </div>
    );
  }

};


export default App;
